import React from 'react'
import styled from 'styled-components'

const Navbarall = styled.div`
width : 100%;
height : 60px;
display : flex;
align-items : center;
justify-content : space-around
`


const Imgdiv = styled.div`
width  : 10%;
height : 60px;
`
const Userinfo = styled.div`
width : 20%;
height : 60px;
border : solid 1px white;
display : flex;
align-items : center;
justify-content : space-around
`


const Username = styled.p`
color : white;
`


const Userlogo = styled.div`
width : 20%;
height : 60px
`



function Navbar() {



  return (
    <div>
    <Navbarall>

    <Imgdiv>
    <img src = "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQAGAKKpRvnKiKVxgSGror92eROldFG1oCuMcEis8aORGPZEcQ_YY4hw4iY3edx7voiBnY&usqp=CAU" className = "img-fluid"/>
    </Imgdiv>

    <Userinfo>
    <Username>Ellez</Username>
    <Userlogo><img src = "https://d2gg9evh47fn9z.cloudfront.net/800px_COLOURBOX25634105.jpg" className = "img-fluid"/></Userlogo>



    </Userinfo>



    </Navbarall>
    </div>
  )
}

export default Navbar
